import { useState } from 'react'
import { NavLink } from 'react-router-dom'
import { ReactComponent as Hamburger } from '../../assets/hamburger.svg'
import './navbar.css'
import AuthUser from '../login/AuthUser'
import { SfNav } from 'react-sf-building-blocks';

const Navbar = () => {
  const [showNavbar, setShowNavbar] = useState(false)

  const [isAuthenticated , setIsAuthenticated] = useState(false);

  const handleShowNavbar = () => {
    setShowNavbar(!showNavbar)
  }

  return (
    <nav className="navbar">
      <div className="container">
        <div className="logo">
        <b>Diagno<span>Care</span></b>
        </div>
        <div className="menu-icon" onClick={handleShowNavbar}>
          <Hamburger />
        </div>
        <div className={`nav-elements  ${showNavbar && 'active'}`}>
          <ul>
            <li>
              <NavLink to="/">Home</NavLink>
            </li>
            <li>
              <NavLink to="/diabetes">Diabetes</NavLink>
            </li>
            <li>
              <NavLink to="/lungcancer">LungCancer</NavLink>
            </li>
            <li>
              <NavLink to="/alzheimer">Alzheimer's</NavLink>
            </li>
            <li>
              <NavLink to="/braintumor">BrainTumor</NavLink>
            </li>
            {
                !isAuthenticated ? <li>
                  <SfNav
        showProfile={true}
        profilePicture="https://i.pinimg.com/736x/7f/79/6d/7f796d57218d9cd81a92d9e6e8e51ce4--free-avatars-online-profile.jpg"
        profileMenu={[
          { caption: 'Profile', link: 'profile' },
          [
            { caption: 'Settings', link: 'support' },
            { caption: 'Notifications', link: 'notifications' },
            { caption: 'Privacy', link: 'privacy' },
          ],
          { caption: 'Support', link: 'support' },
          { caption: 'Upgrade', link: 'upgrade' },
        ]}
        profilePreamble={
          <div
            style={{
              width: '100%',
              paddingTop: '10px',
              paddingBottom: '10px',
              paddingLeft: '10px',
              paddingRight: '10px',
            }}
          >
            <small>Hi Hrushi!</small>
            <br />
            <small>
              <small>
                <i>Welcome to Superflows!</i>
              </small>
            </small>
          </div>
        }
        profileComponent={
          <div
            style={{
              width: '100%',
              paddingTop: '10px',
              paddingBottom: '10px',
              paddingLeft: '10px',
              paddingRight: '10px',
            }}
          >
            <small>Sign Out</small>
          </div>
        }
        signInCaption="Subscribe"
        onMenuClicked={(value) => {
          alert(value);
        }}
        onSignInPressed={() => {
          alert('Subscribe pressed!');
        }}
        stylesProfilePictureContainer={{
          backgroundColor: 'black',
          padding: '2px',
          color: 'white',
          borderRadius: '5px',
        }}
        stylesProfilePreamble={{ backgroundColor: 'white', color: 'black' }}
        stylesProfileComponent={{ backgroundColor: 'white', color: 'black' }}
        stylesMenu={{
          backgroundColor: 'black',
          color: 'white',
          paddingTop: '3px',
          paddingBottom: '3px',
          paddingLeft: '10px',
          paddingRight: '10px',
          borderRadius: '5px',
        }}
        stylesSubMenu={{
          backgroundColor: 'black',
          color: 'white',
          paddingLeft: '5px',
          paddingRight: '5px',
          border: 'solid 1px gray',
        }}
        stylesMenuMobile={{
          backgroundColor: 'black',
          color: 'white',
          paddingLeft: '5px',
          paddingRight: '5px',
          borderRadius: '5px',
          border: 'solid 1px gray',
        }}
        stylesMenuMobileSelected={{
          backgroundColor: 'white',
          color: 'black',
          paddingLeft: '5px',
          paddingRight: '5px',
          borderRadius: '5px',
          border: 'solid 1px gray',
        }}
        stylesSubMenuMobile={{
          backgroundColor: 'black',
          color: 'white',
          paddingLeft: '5px',
          paddingRight: '5px',
          borderRadius: '5px',
          border: 'solid 1px gray',
        }}
      />
              </li> : 
              <li>
                <NavLink to="/login">SignIn</NavLink>
              </li>
            }
          </ul>
        </div>
      </div>
    </nav>
  )
}

export default Navbar
